export const goToCandidate = (history) => {
  history.push("/candidate");
};

export const goToMentor = (history) => {
  history.push("/mentor");
};

export const goToComapany = (history) => {
  history.push("/company");
};

export const goBack = (history) => {
  history.goBack();
};
